import { Buffer } from 'buffer';
import * as oasis from 'oasis-std';
export class DiceGame {
    public static BYTECODE =
        '';
    private constructor(
        readonly address: oasis.Address,
        private gateway: oasis.Gateway,
    ) {}
    public static async connect(
        address: oasis.Address,
        gateway: oasis.Gateway,
    ): Promise<DiceGame> {
        return new DiceGame(address, gateway);
    }
    public static async deploy(
        gateway: oasis.Gateway,
        { numPlayers }: { numPlayers: number },
        options?: oasis.DeployOptions,
    ): Promise<DiceGame> {
        const payload = DiceGame.makeDeployPayload(numPlayers);
        try {
            const deployedAddr = await gateway.deploy(payload, options);
            return new DiceGame(deployedAddr, gateway);
        } catch (e) {
            throw e;
        }
    }
    private static makeDeployPayload(numPlayers: number): Buffer {
        const encoder = new oasis.Encoder();
        encoder.writeU8Array(Buffer.from(DiceGame.BYTECODE, 'base64'));
        return oasis.abiEncode(['u32' as oasis.Schema], [numPlayers], encoder);
    }
    public async isInPlay(options?: oasis.RpcOptions): Promise<boolean> {
        const payload = DiceGame.makeIsInPlayPayload();
        try {
            const res = await this.gateway.rpc(this.address, payload, options);
            return oasis.abiDecode('boolean' as oasis.Schema, res);
        } catch (e) {
            throw e;
        }
    }
    private static makeIsInPlayPayload(): Buffer {
        const encoder = new oasis.Encoder();
        encoder.writeU8(0);
        return encoder.finish();
    }
    public async numPlayers(options?: oasis.RpcOptions): Promise<number> {
        const payload = DiceGame.makeNumPlayersPayload();
        try {
            const res = await this.gateway.rpc(this.address, payload, options);
            return oasis.abiDecode('u32' as oasis.Schema, res);
        } catch (e) {
            throw e;
        }
    }
    private static makeNumPlayersPayload(): Buffer {
        const encoder = new oasis.Encoder();
        encoder.writeU8(1);
        return encoder.finish();
    }
    public async maxScore(options?: oasis.RpcOptions): Promise<number> {
        const payload = DiceGame.makeMaxScorePayload();
        try {
            const res = await this.gateway.rpc(this.address, payload, options);
            return oasis.abiDecode('u32' as oasis.Schema, res);
        } catch (e) {
            throw e;
        }
    }
    private static makeMaxScorePayload(): Buffer {
        const encoder = new oasis.Encoder();
        encoder.writeU8(2);
        return encoder.finish();
    }
    public async roll(
        { pName }: { pName: string },
        options?: oasis.RpcOptions,
    ): Promise<number> {
        const payload = DiceGame.makeRollPayload(pName);
        try {
            const res = await this.gateway.rpc(this.address, payload, options);
            return oasis.abiDecode('u32' as oasis.Schema, res);
        } catch (e) {
            if (e instanceof oasis.RpcError.Execution) {
                throw oasis.abiDecode('string' as oasis.Schema, e[0]);
            }
            throw e;
        }
    }
    private static makeRollPayload(pName: string): Buffer {
        const encoder = new oasis.Encoder();
        encoder.writeU8(3);
        return oasis.abiEncode(['string' as oasis.Schema], [pName], encoder);
    }
    public async winner(options?: oasis.RpcOptions): Promise<string[]> {
        const payload = DiceGame.makeWinnerPayload();
        try {
            const res = await this.gateway.rpc(this.address, payload, options);
            return oasis.abiDecode(
                ['string', Number.POSITIVE_INFINITY] as oasis.Schema,
                res,
            );
        } catch (e) {
            if (e instanceof oasis.RpcError.Execution) {
                throw oasis.abiDecode('string' as oasis.Schema, e[0]);
            }
            throw e;
        }
    }
    private static makeWinnerPayload(): Buffer {
        const encoder = new oasis.Encoder();
        encoder.writeU8(4);
        return encoder.finish();
    }
}
